def MinCostTickets(days: List[int], costs: List[int]) -> int:
    if len(costs) != 3:
        raise ValueError("costs must have length 3")
    if any(c < 0 for c in costs):
        raise ValueError("all costs must be non-negative")
    if any(d < 0 for d in days):
        raise ValueError("all days must be non-negative")
    if not all(days[i] < days[i+1] for i in range(len(days)-1)):
        raise ValueError("days must be strictly increasing")

    if not days:
        return 0

    dayset = set(days)
    last_day = days[-1]
    dp = [0] * (last_day + 1)

    for d in range(1, last_day + 1):
        if d not in dayset:
            dp[d] = dp[d-1]
        else:
            cost1 = dp[d-1] + costs[0]
            cost7 = dp[max(0, d-7)] + costs[1]
            cost30 = dp[max(0, d-30)] + costs[2]
            dp[d] = min(cost1, cost7, cost30)
    return dp[last_day]
