def CountNoOfWays(n: int, k: int) -> int:
    if n < 1 or k < 1:
        raise ValueError("Precondition failed: n >= 1 and k >= 1 required")
    mod = 1000000007
    dp = [0] * (n + 2)  # dp[0] unused, dp[1..n] used
    dp[1] = k
    if n == 1:
        return dp[1] % mod
    dp[2] = k * (k - 1)
    if n == 2:
        return dp[2] % mod
    for i in range(3, n + 1):
        dp[i] = ((k - 1) * (dp[i - 1] + dp[i - 2])) % mod
    return dp[n] % mod
