    """
    Checks if the input sequence of characters represents a valid IPv4 address.
    Returns a sequence of characters: "Valid IP address" or "Invalid IP address".
    """
    # Convert input to string for easier processing
    ip_str = ''.join(Ip)
    parts = ip_str.split('.')
    if len(parts) != 4:
        return list("Invalid IP address")
    for part in parts:
        if len(part) == 0:
            return list("Invalid IP address")
        if not part.isdigit():
            return list("Invalid IP address")
        if len(part) > 1 and part[0] == '0':
            return list("Invalid IP address")
        num = int(part)
        if num < 0 or num > 255:
            return list("Invalid IP address")
    return list("Valid IP address")

